import requests
from time import sleep
from dotenv import load_dotenv
import os

load_dotenv()

# ToDo move it to env
api_url = "https://api.2captcha.com/createTask"
api2_url = "https://api.2captcha.com/getTaskResult"

api_key = os.getenv("API_KEY")
def solveCaptcha(img) -> str:
    
    task = {
    "clientKey":api_key,
    "task":{
        "type": "ImageToTextTask",
            "body": img,
            "phrase": False,
            "case": True,
            "numeric": 1,
            "math": False,
            "minLength": 1,
            "maxLength": 5,
            "comment": "enter the text you see on the image"
    },
    "languagePool": "en"
    }
    response = requests.post(api_url, json=task)
    response_data = response.json()
    taskId=response_data["taskId"]
    if not taskId*0 == 0:
        return "false"

    for i in range(20):
        response = requests.post(api2_url, json={"clientKey":api_key, "taskId":taskId})
        response_data = response.json()
        sleep(2)
        if "status" in response_data:
            if response_data["status"]=="ready":
                return response_data["solution"]["text"]
        
    return "false"

if __name__ == "__main__":
    result = solveCaptcha("data:image/png;base64,")
    print(result)